import React from 'react';
// import ReactDom from 'react-dom';
import { Routes, Route, Link } from "react-router-dom";
import './App.css';

function Hello(){
  return(
      <h1> Hello world</h1>
   )
  }
function World(){
  return(
    <h1> my world </h1>
  )
}

function App() {
  return (
    <div className="App">
      <nav className='navbar-react'>
        <Link to='/' className='navbar-item'> Hello</Link>
        <Link to='/world' className='navbar-item'> World</Link>
      </nav>

      <Routes>
        <Route path='/' element={<Hello />}/>
        <Route path='/about' element={<World/ >}/>
      </Routes>
    </div>
  );
}

export default App;
